import React from 'react'; 

const HemisphereDisplay =({latitude})=> {
	const hemisphere = latitude > 0 ? 'Northern Hemisphere' : 'Southern Hemisphere'
	return(
		<div>
		{hemisphere}
		</div>
		)
}

export default HemisphereDisplay;
